(24, 0, 0, 0, 0, NULL, 'visao', 0, 0, '', '', 'H tr tr nhit tnh', '', 'ho-tro-tro-nhiet-tinh', '', '', '', 0, 0, 0, 0, 'i ng k thut vin ca chng ti lun thng trc 24/7  h tr bn khc phc cc s c xy ra v a n tr li hot ng bnh thng trong thi gian ngn nht c th.\r\n\r\n', '', '', '', '', '', '', '', '', '', 4, 1, 1556785739, 1556873537, 0, '', '', '', '', '', '', '', '', '', '', '', 0, '', '', '', '', '', '', '', '', '', '', NULL),
(25, 0, 0, 0, 0, NULL, 'visao', 0, 0, '', '', ' Gi c hp l ', '', 'gia-ca-hop-ly', '', '', '', 0, 0, 0, 0, 'Cc dch v ca chng ti c thit k  p ng cc yu cu khc nhau ca Khch hng v cn nhc n cc tnh hung, hon cnh khc nhau.', '', '', '', '', '', '', '', '', '', 3, 1, 1556785748, 1556873505, 0, '', '', '', '', '', '', '', '', '', '', '', 0, '', '', '', '', '', '', '', '', '', '', NULL),
(26, 0, 0, 0, 0, NULL, 'visao', 0, 0, '', '', 'S hi lng ca khch hng l u tin s 1 ', '', 'su-hai-long-cua-khach-hang-la-uu-tien-so-1', '', '', '', 0, 0, 0, 0, 'Chng ti lun coi s hi lng ca khch hng l mc tiu phn u ca cng ty chng ti.  l v sao chng ti lun coi trng s kt ni v mi quan h bn vng vi khch hng.', '', '', '', '', '', '', '', '', '', 1, 1, 1556785755, 1556873460, 0, '', '', '', '', '', '', '', '', '', '', '', 0, '', '', '', '', '', '', '', '', '', '', NULL),
(34, 0, 0, 0, 0, NULL, 'visao', 0, 0, '', '', 'Dch V Cung Cp Nhanh Nht ', '', 'dich-vu-cung-cap-nhanh-nhat', '', '', '', 0, 0, 0, 0, 'Chng ti lun m bo tin  cung cp dch v nhanh chng, chnh xc v y  n khch hng ', '', '', '', '', '', '', '', '', '', 2, 1, 1556873419, 1556873582, 0, '', '', '', '', '', '', '', '', '', '', '', 0, '', '', '', '', '', '', '', '', '', '', NULL),
(76, 0, 0, 0, 0, NULL, 'tintuc', 1, 0, 'kt-9991.jpg', 'kt-9991_280x170.jpg', 'VI PHM HNH CHNH TRONG LNH VC K TON PHT N 100 TRIU NG', '', 'vi-pham-hanh-chinh-trong-linh-vuc-ke-toan-phat-den-100-trieu-dong', '', '', '', 0, 0, 0, 0, 'Pht tin t 5-10 triu ng i vi mt trong cc hnh vi sau:Lp chng t k ton khng  s lin theo quy nh ca mi loi chng t k ton', '<p dir=\"ltr\">Pht tin t 5-10 triu ng i vi mt trong cc hnh vi sau:&nbsp;<strong>Lp chng t k ton khng  s lin theo quy nh ca mi loi chng t k ton</strong>; k chng t k ton khi cha ghi  ni dung chng t thuc trch nhim ca ngi k; k chng t k ton m khng ng thm quyn;&nbsp;<strong>ch k ca mt ngi khng thng nht hoc khng ng vi s ng k mu ch k</strong>; chng t k ton khng c  ch k theo chc danh quy nh trn chng t; khng dch chng t k ton bng ting nc ngoi ra ting Vit theo quy nh;&nbsp;<strong> h hng, mt mt ti liu, chng t k ton ang trong qu trnh s dng</strong>.</p>\r\n\r\n<p dir=\"ltr\">Pht tin t 20 - 30 triu ng i vi mt trong cc hnh vi: Gi mo, khai man chng t k ton nhng cha n mc truy cu trch nhim hnh s; tha thun hoc p buc ngi khc gi mo, khai man chng t k ton nhng cha n mc truy cu trch nhim hnh s; lp chng t k ton c ni dung cc lin khng ging nhau trong trng hp phi lp chng t k ton c nhiu lin cho mt nghip v kinh t, ti chnh pht sinh; khng lp chng t k ton khi nghip v kinh t, ti chnh pht sinh; lp nhiu ln chng t k ton cho mt nghip v kinh t, ti chnh pht sinh; thc hin chi tin khi chng t chi tin cha c y  ch k ca ngi c thm quyn theo quy nh ca php lut v k ton.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<img height=\"289\" src=\"http://madeco.com.vn/upload/images/image-20190508132148-1.png\" width=\"479\" /></p>\r\n\r\n<p dir=\"ltr\"><strong>Pht nng hnh vi khai man s liu bo co ti chnh</strong></p>\r\n\r\n<p dir=\"ltr\">Ngh nh cng quy nh c th mc pht hnh vi vi phm quy nh v lp v trnh by bo co ti chnh. C th, pht tin t 5 - 10 triu ng i vi mt trong cc hnh vi: Lp bo co ti chnh khng y  ni dung hoc khng ng biu mu theo quy nh; bo co ti chnh khng c ch k ca ngi lp, k ton trng, ph trch k ton hoc ngi i din theo php lut ca n v k ton.</p>\r\n\r\n<p dir=\"ltr\">i vi mt trong cc hnh vi: Lp khng y  cc bo co ti chnh theo quy nh; p dng mu bo co ti chnh khc vi quy nh ca chun mc v ch  k ton tr trng hp  c B Ti chnh chp thun th s b pht tin t 10-20 triu ng.</p>\r\n\r\n<p dir=\"ltr\">Pht tin t 20 - 30 triu ng i vi mt trong cc hnh vi sau: Khng lp bo co ti chnh theo quy nh; lp bo co ti chnh khng ng vi s liu trn s k ton v chng t k ton; lp v trnh by bo co ti chnh khng tun th ng ch  k ton v chun mc k ton.</p>\r\n\r\n<p dir=\"ltr\">Pht tin t 40 - 50 triu ng i vi mt trong cc hnh vi sau: Gi mo bo co ti chnh, khai man s liu trn bo co ti chnh nhng cha n mc truy cu trch nhim hnh s; tha thun hoc p buc ngi khc gi mo bo co ti chnh, khai man s liu trn bo co ti chnh nhng cha n mc truy cu trch nhim hnh s; c , tha thun hoc p buc ngi khc cung cp, xc nhn thng tin, s liu k ton sai s tht nhng cha n mc truy cu trch nhim hnh s.</p>\r\n', '', '', '', '', '', '', '', '', 1, 1, 1557296600, 1592456772, 83, '', '', '', '', '', '', '', '', '', '', '', 0, '', '', '', '', '', '', '', '', '', '', NULL),
(80, 0, 0, 0, 0, NULL, 'tintuc', 1, 0, 'thue-2686.png', 'thue-2686_280x170.png', 'Tng cc Thu t chc tp hun v ha n in t v ch  k ton cho doanh nghip', '', 'tong-cuc-thue-to-chuc-tap-huan-ve-hoa-don-dien-tu-va-che-do-ke-toan-cho-doanh-nghiep', '', '', '', 0, 0, 0, 0, 'Tng cc Thu t chc tp hun v ha n in t v ch  k ton cho doanh nghip', '<h3 id=\"title\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Tng cc Thu t chc tp hun v ha n in t v ch  k ton cho doanh nghip</span></h3>\r\n\r\n<p><span style=\"font-family:Arial,Helvetica,sans-serif;\">Ngy 08/05/2019</span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Nhm mc ch h tr cc doanh nghip siu nh, i l thu, cng ty dch v k ton, kim ton nm bt cc ni dung mi v ch  k ton, quy nh v ho n in t, hm nay ngy 8/5/2019 ti Vn phng Tng cc Thu, Tng cc Thu phi hp vi Hi t vn thu Vit Nam, Cc Qun l gim st K ton, kim ton  B Ti chnh t chc tp hun ph bin, hng dn chnh sch v ho n in t quy nh ti Ngh nh 119/N-CP ngy 13/9/2018 v quy nh v k ton theo Thng t s 132/2018/TT-BTC ngy 28/12/2018, ng thi&nbsp; trc tip gii p cc vng mc, kin ngh ca doanh nghip.</span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><img alt=\"\" src=\"http://www.gdt.gov.vn/wps/wcm/connect/c2b15864-a66a-4990-a872-19dccf298f9f/1/IMG_1557279854126_1557280100399.jpg?MOD=AJPERES&amp;CACHEID=ROOTWORKSPACEc2b15864-a66a-4990-a872-19dccf298f9f/1\" title=\"\" width=\"450\" /></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><em>nh: Ton cnh Hi ngh tp hun</em></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Hi ngh din ra trong vng mt ngy vi s tham d ca hn 500 Doanh nghip siu nh, cc i l thu v cc Cng ty dch v K ton. Ngoi phn hng dn v ha n in t v ch  k ton, hi ngh cn dnh thi gian  cc doanh nghip tham d t cu hi, vng mc v ha n in t v ch  k ton. Cc vng mc doanh nghip tp trung ch yu v i tng s dng ha n in t, thi im p dng ha n in t, cch iu chnh sai st i vi ha n in t  lp V K ton, &nbsp;cc vng mc tp trung vo i tng p dng ch  k ton cho Doanh nghip siu nh, cch ghi chp, iu chnh gia chi ph tnh thu v chi ph k ton Cc vng mc ca cc Doanh nghip  c i din cc V ca Tng cc Thu, i din Cc Qun l gim st K ton, kim ton, i din Hi t vn Thu Vit Nam trc tip tr li ngay ti hi ngh.</span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><img alt=\"\" src=\"http://www.gdt.gov.vn/wps/wcm/connect/c2b15864-a66a-4990-a872-19dccf298f9f/2/IMG_20190508_155256.jpg?MOD=AJPERES&amp;CACHEID=ROOTWORKSPACEc2b15864-a66a-4990-a872-19dccf298f9f/2\" title=\"\" width=\"450\" /></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><em>nh: Bn ch to gii p vng mc v ho n in t ti hi ngh</em></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; Ngy 15/5/2019, ti Hi trng Cc Thu TP H Ch Minh, Tng cc Thu s tip tc t chc tp hun v ha n in t v ch  k ton cho doanh nghip ti TP H Ch Minh.</span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\">Mt s hnh nh ti bui tp hun:</span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><img alt=\"\" src=\"http://www.gdt.gov.vn/wps/wcm/connect/c2b15864-a66a-4990-a872-19dccf298f9f/3/IMG_20190508_155406.jpg?MOD=AJPERES&amp;CACHEID=ROOTWORKSPACEc2b15864-a66a-4990-a872-19dccf298f9f/3\" title=\"\" width=\"450\" /></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><em>nh: ng Trnh c Vinh  Ph cc Trng Cc QLGS K ton, kim ton trnh by v chnh sch k ton</em></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><img alt=\"\" src=\"http://www.gdt.gov.vn/wps/wcm/connect/c2b15864-a66a-4990-a872-19dccf298f9f/4/IMG_1557279846775_1557280100095.jpg?MOD=AJPERES&amp;CACHEID=ROOTWORKSPACEc2b15864-a66a-4990-a872-19dccf298f9f/4\" title=\"\" width=\"450\" /></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><em>nh: B Nguyn Th Thu H - V Chnh sch, Tng cc Thu trnh by chnh sch ho n in t</em></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><img alt=\"\" src=\"http://www.gdt.gov.vn/wps/wcm/connect/c2b15864-a66a-4990-a872-19dccf298f9f/5/IMG_20190508_155240.jpg?MOD=AJPERES&amp;CACHEID=ROOTWORKSPACEc2b15864-a66a-4990-a872-19dccf298f9f/5\" title=\"\" width=\"450\" /></span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-family:Arial,Helvetica,sans-serif;\"><em>nh: Bn ch to gii p vng mc v chnh sch k ton ti hi ngh</em></span></p>\r\n', '', '', '', '', '', '', '', '', 1, 1, 1557391167, 1592456751, 68, '', '', '', '', '', '', '', '', '', '', '', 0, '', '', '', '', '', '', '', '', '', '', NULL);
