(46, 0, 0, 0, 0, NULL, 'tintuc', 1, 0, 'nop-thue-dt-7089.png', 'nop-thue-dt-7089_280x170.png', 'Thng bo V/v trin khai dch v Thu in t (eTax services) cho 15 tnh/thnh ph ', '', 'thong-bao-vv-trien-khai-dich-vu-thue-dien-tu-etax-services-cho-15-tinhthanh-pho', '', '', '', 0, 0, 0, 0, '', '<p>TNG CC THU THNG BO Thng bo V/v Chuyn i h thng iHTKK, NTT sang h thng mi i vi doanh nghip thuc qun l ca C quan thu cc tnh/thnh ph: H Ni, Tuyn Quang, H Nam, Hi Phng, Nam nh, Ninh Bnh, Thi Bnh, Vnh Phc, Qung Ninh, Sn La, Thanh Ho, Ngh An, H Tnh, Qung Bnh, ng Nai T 17h30 ngy 4/5/2019 n 8h ngy 6/5/2019, Tng cc Thu dng h thng khai thu in t (iHTKK) v Np thu in t (NTT) i vi cc doanh nghip thuc qun l ca C quan thu cc tnh/thnh ph: H Ni, Tuyn Quang, H Nam, Hi Phng, Nam nh, Ninh Bnh, Thi Bnh, Vnh Phc, Qung Ninh, Sn La, Thanh Ho, Ngh An, H Tnh, Qung Bnh, ng Nai  chuyn i sang h thng mi Dch v thu in t (eTax). Bt u t 8h ngy 6/5/2019, cc doanh nghip trn s dng h thng eTax ti ng dn http://thuedientu.gdt.gov.vn thay th cho h thng khai thu (ti ng dn http://nhantokhai.gdt.gov.vn) v np thu (ti ng dn http://nopthue.gdt.gov.vn)  thc hin khai thu, np thu, hon thu in t. Cch ng nhp v s dng dch v trn h thng eTax nh sau: - Trng hp ngi s dng  c mt khu ca h thng Np thu in t  s dng trc  (v d mt khu l: 123456) ti website nopthue.gdt.gov.vn, ngi s dng ng nhp vo eTax bng ti khon: MST-QL (v d: 0100231226-QL), nhp mt khu (l mt khu ng nhp vo h thng Np thu in t  c: 123456)  s dng tt c cc dch v: Khai thu, Hon thu, Np thu, Tra cu, Qun l v phn quyn ti khon, Hi p. T ti khon ny, ty theo yu cu qun l ca doanh nghip, ngi s dng c th to, phn quyn cho cc ti khon ph (phn quyn cho cn b qun l theo chc nng). Cch thc phn quyn chi tit qu v c th xem v ti ti phn hng dn s dng ng dng. - Trng hp ngi s dng c mt khu ca h thng Khai thu in t  s dng trc  ti website nhantokhai.gdt.gov.vn (v d mt khu l: 567890), ngi s dng ng nhp vo eTax bng ti khon: MST (v d: 0100231226), nhp mt khu (l mt khu ng nhp vo h thng Khai thu in t  c l: 567890)  s dng dch v