(185, 0, 0, 0, 0, NULL, 'tintuc', 1, 0, 'bhxh-973.jpg', 'bhxh-973_280x170.jpg', 'D02-LT Bo co tnh hnh SDL v DS tham gia BHXH, BHYT, BHTN theo Quyt nh 1040/Q-BHXH', '', 'd02lt-bao-cao-tinh-hinh-sdld-va-ds-tham-gia-bhxh-bhyt-bhtn-theo-quyet-dinh-1040qdbhxh', '', '', '', 0, 0, 0, 0, '', '<p><strong>D02-LT Bo co tnh hnh SDL v DS tham gia BHXH, BHYT, BHTN theo Quyt nh 1040/Q-BHXH</strong></p>\r\n\r\n<p><strong>Ti v&nbsp;</strong><a href=\"https://www.baohiemxahoidientu.vn/main/download/getckfinderimage?path=/files/D02-LT%20theo%201040.xlsx\"><b>Mu D02-LT</b></a></p>\r\n\r\n<p align=\"center\"><b>HNG DN LP</b></p>\r\n\r\n<p align=\"center\"><b>Bo co tnh hnh s dng lao ng v danh sch tham gia BHXH, BHYT, BHTN (Mu D02-LT)</b></p>\r\n\r\n<p>a) Mc ch:  n v, doanh nghip ng k; truy thu, iu chnh ng BHXH, BHYT, BHTN, BHTNL, BNN; cp s BHXH, th BHYT v khai bo tnh hnh s dng lao ng i vi ngi lao ng thuc n v.</p>\r\n\r\n<p>b) Trch nhim lp: n v s dng lao ng.</p>\r\n\r\n<p>c) Thi gian lp: khi c pht sinh v lao ng, tin lng v truy thu i vi ngi lao ng thuc n v.</p>\r\n\r\n<p>d) Cn c lp</p>\r\n\r\n<p>- T khai tham gia BHXH, BHYT (Mu TK1-TS);</p>\r\n\r\n<p>- HL, HLV, quyt nh tuyn dng, tip nhn; quyt nh nng lng, thuyn chuyn</p>\r\n\r\n<p>- H s khc c lin quan.</p>\r\n\r\n<p>) Phng php lp</p>\r\n\r\n<p><img alt=\"Bo co tnh hnh s dng lao ng\" src=\"https://www.baohiemxahoidientu.vn/main/download/getckfinderimage?path=/files/Bao-cao-tinh-hinh-su-dung-lao-dong.jpg\" /></p>\r\n\r\n<p><em>Mu bo co tnh hnh s dng lao ng v danh sch tham gia BHXH, BHYT, BHTN</em></p>\r\n\r\n<p>* Phn thng tin chung</p>\r\n\r\n<p>- Tn n v: ghi y  tn n v theo ng k kinh doanh, quyt nh thnh lp.</p>\r\n\r\n<p>- M n v: ghi m n v do c quan BHXH cp.</p>\r\n\r\n<p>- M s thu: ghi m s thu do c quan thu cp.</p>\r\n\r\n<p>- a ch: ghi a ch ni ng tr s ca n v.</p>\r\n\r\n<p>- in thoi: ghi s in thoi ca n v.</p>\r\n\r\n<p>- Email: ghi tn email ca n v.</p>\r\n\r\n<p>* Ch tiu theo ct:</p>\r\n\r\n<p>- Ct (1): Ghi s th t t nh n ln.</p>\r\n\r\n<p>- Ct (2): Ghi r h, tn ca tng ngi lao ng</p>\r\n\r\n<p>i vi nhng n v c s lng ngi tham gia BHYT ln, c yu cu phn nhm i tng  thun tin trong vic tip nhn v tr th BHYT, c quan BHXH c trch nhim hng dn cc n v khi lp danh sch cp th BHYT, ti ct (2) tch thnh cc nhm theo m n v trc thuc (nhm v m n v trc thuc do n v t xy dng nhng ti a khng qu 6 k t c k hiu bng s hoc bng ch).</p>\r\n\r\n<p>V d: Cng ty A c 02 phn xng trc thuc, mi phn xng c 50 lao ng th Cng ty A khi lp danh sch phn thnh 02 nhm: Phn xng 1, m s 01, km theo danh sch ca 50 lao ng thuc Phn xng 1; tip theo l Phn xng 2, m s 02, km theo danh sch 50 lao ng ca Phn xng 2 (m s n v trc thuc c th l 01, 02 hoc AA, AB hoc nhiu k t hn nhng khng qu 6 k t).</p>\r\n\r\n<p>- Ct (3):&nbsp;Ghi m s i vi ngi&nbsp;ngi  c m s BHXH.</p>\r\n\r\n<p>- Ct (4): Ghi y  ngy, thng, nm sinh nh trong giy khai sinh hoc chng minh nhn dn/cn cc cng dn/h chiu.</p>\r\n\r\n<p>- Ct (5): Ghi gii tnh ca ngi tham gia (nu l nam th ghi t nam hoc nu l n th ghi t n).</p>\r\n\r\n<p>- Ct (6): Ghi s cn cc cng dn /chng minh nhn dn/h chiu ca ngi tham gia c c quan c thm quyn cp (Ring h chiu ch dnh cho ngi nc ngoi).</p>\r\n\r\n<p>- Ct (7): Ghi y , chi tit v cp bc, chc v, chc danh ngh, cng vic, iu kin ni lm vic theo quyt nh hoc HL, HLV (V d: Ph Chnh thanh tra S A, cng nhn vn hnh my may cng nghip Cng ty B ...).</p>\r\n\r\n<p>- Cc Ct (8), (9), (10), (11): Phn loi theo: nh qun l; chuyn mn k thut bc cao; chuyn mn k thut bc trung; nhn vin tr l vn phng; nhn vin dch v v bn hng; lao ng c k nng trong nng nghip, lm nghip v thy sn; th th cng; th vn hnh v lp rp my mc thit b; lao ng gin n.</p>\r\n\r\n<p>- Ct (12): Ghi tin lng c hng:</p>\r\n\r\n<p>+ Ngi lao ng thc hin ch  tin lng do Nh nc quy nh th ghi bng h s (bao gm c h s chnh lch bo lu nu c).</p>\r\n\r\n<p>V d: Tin lng ghi trong quyt nh tuyn dng hoc HLV l 2,34 th ghi 2,34.</p>\r\n\r\n<p>+ Ngi lao ng thc hin ch  tin lng do ch s dng lao ng quyt nh th ghi mc lng theo cng vic hoc chc danh, bng tin ng Vit Nam.</p>\r\n\r\n<p>V d: mc lng ca ngi 