(23, 'chukyso', 'Phn mm Hi quan in t', '', 1, 'Gii php hi quan in t hng u Vit Nam vi tnh nng qun l nghip v thng quan, khai bo dch v cng, qun l, lu tr d liu trc tuyn.', '', '', '', 'phan-mem-hai-quan-dien-tu', '', '', '', '', '', '', 'hai-quan-dien-tu-1767.jpg', 'hai-quan-dien-tu-1767_380x250.jpg', 4, 1, 1594607236, 1594743876, '', '<p>H thng <b>&nbsp;</b>c thit k theo chun mc ca H thng Hi quan in t hin i, p ng y  cc quy trnh nghip v ca h thng VNACCS/VCIS do Hi quan Nht Bn ti tr. M rng cc th tc ng k nh th tc ng k danh mc min thu, th tc p dng chung c hng mu dch v phi mu dch, th tc n gin i vi hng ha tr gi thp, qun l hng ha tm nhp, ti xut. ng thi vn h tr y  cc chc nng khai bo n h thng tip nhn tp trung, chun thng ip kt ni c cp nht lin tc theo thng t ban hnh mi nht.</p>\r\n', '');
