(1, '', '', '', '', '', '<table align=\"center\" border=\"0\" cellpadding=\"3\" cellspacing=\"0\" class=\"tplCaption\" style=\"width: 100%;\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"thua-soc-truoc-ireland-duc-lo-co-hoi-gianh-ve-som-du-euro\" data-natural-width=\"500\" data-pwidth=\"470.4\" data-width=\"500\" src=\"http://c1.f1.img.vnecdn.net/2015/10/09/duc-9716-1444345590.jpg\" style=\"width: 100%;\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p class=\"Image\">Ireland buc c phi ch n lt u cui mi c&oacute; th gi&agrave;nh v&eacute; ti Ph&aacute;p. nh: <em>Reuters</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p class=\"Normal\">Kt qu: Ireland 1-0 c</p>\r\n\r\n<p class=\"Normal\">B&agrave;n thng: Shane Long 70&#39;</p>\r\n\r\n<div style=\"text-align:center;\">\r\n<div class=\"embed-container\">&nbsp;</div>\r\n</div>\r\n\r\n<p class=\"Normal\">V&agrave;o s&acirc;n vi i h&igrave;nh gn nh mnh nht, c thoi m&aacute;i chim u th trc ch nh&agrave; Ireland. Nhng iu g&acirc;y tht vng l&agrave; c&aacute;c cu th mang danh ng kim v&ocirc; ch World Cup li&ecirc;n tc b l c hi.</p>\r\n\r\n<p class=\"Normal\">Ozil, Gundogan v&agrave; Reus c&oacute; ba t&igrave;nh hung dt im t v tr&iacute; trng tri trc khung th&agrave;nh th m&ocirc;n Shay Given, nhng u kh&ocirc;ng ho&agrave;n th&agrave;nh nhim v. Ng&ocirc;i sao ca CLB Arsenal cng c&oacute; mt ln a b&oacute;ng v&agrave;o li Ireland, nhng kh&ocirc;ng c c&ocirc;ng nhn b&agrave;n thng do li vit v.</p>\r\n\r\n<p class=\"Normal\">Kh&ocirc;ng c th h&oacute;a c u th, c phi tr gi&aacute; t  ph&uacute;t 70. Trong t&igrave;nh hung tn c&ocirc;ng s&aacute;ng sa gn nh duy nht ca Ireland, tin o Shane Long tho&aacute;t xung s&uacute;t ch&eacute;o v&agrave;o g&oacute;c cao, &aacute;nh bi th m&ocirc;n Neuer.</p>\r\n\r\n<p class=\"Normal\">Vi chin thng bt ng trc c, Ireland hi sinh hy vng ti v&ograve;ng loi Euro 2016. i n&agrave;y hin xp th ba bng D vi 18 im, bng th&agrave;nh t&iacute;ch vi Ba Lan v&agrave; k&eacute;m c mt im. Trong lt u cui, Ireland cn thng tr&ecirc;n s&acirc;n ca Ba Lan  gi&agrave;nh v&eacute; trc tip ti v&ograve;ng chung kt.</p>\r\n\r\n<p class=\"Normal\">Trong khi &oacute;, tht bi trc Ireland &atilde; l&agrave;m c l c hi gi&agrave;nh v&eacute; sm mt lt u. Nhng khi gp Gruzia gia tun sau, thy tr&ograve; HLV Joachim Low ch cn gi&agrave;nh &iacute;t nht mt kt qu h&ograve;a l&agrave; c&oacute; v&eacute; i Ph&aacute;p d ng&agrave;y hi ln h&egrave; nm sau.</p>\r\n', '', '', '', '', '', '', '', '', 1, 0, 1444360406, 0, '', '', ''),
